import styled from "styled-components";

export const Container = styled.div`
  background-color: red;
  width: 80px;

  position: absolute;
  top: 0;
  width: 100%;
  display: flex;

  h1 {
      font-weight: 300;
      font-size: 0.7rem;
  }

`;
